import React from "react";
import styled from "styled-components";
import ironMan from "../images/player.png";

export default function Player() {
  return (
    <Wrapper>
      <div>
        <img src={`${ironMan}`} />
      </div>
    </Wrapper>
  );
}

const Wrapper = styled.div``;
